import React from "react";

const CartSummary = (props) => {
  return (
    <React.Fragment>
      <h4>Summary</h4>
      <div className="border-small"></div>
      <div>
        <input
          type="text"
          className="couponCode"
          placeholder="Enter Coupon Code"
        />
        <div>Subtotal</div>
        <div>Shipping</div>
        <div>Taxes</div>
      </div>
      
    </React.Fragment>
  );
};

export default CartSummary;
